import React,{useContext, useState} from 'react'
import '../styles/Passengerdetails.css'
import flightContent from "../context/FlightContext";

const Passengerdetails = () => {
    const [credentials, setCredentials] = useState({title:"",firstname:"",lastname:"",dateofbirth:"",nationality:"",gender:"",passport:"",passportexpirydate:""})
    const [placeholder, setPlaceholder] = useState({"fname":"dnone", "lname":"dnone","dob":"dnone", })
    const [height,setHeight] = useState({"fname":"ihide", "lname":"ihide","dob":"ihide", })
    const onChangelogin = (e) => {
        setCredentials({ ...credentials,[e.target.name]: e.target.value})
      }

    const content = useContext(flightContent)
    const {selectedflight} = content 

  return (
    <div className='passenger-d-con'>
        <div>Passenger Details</div>
        <form className='pd-form'>
            <div>{localStorage.getItem('token')?<select className="form-select" aria-label="Default select example">
                    <option selected>Open this select menu</option>
                    <option value="1">One</option>
                    <option value="2">Two</option>
                    <option value="3">Three</option>
                </select>:<></>}
            </div>
            <div>
                <select className="form-select" aria-label="Default select example">
                    <option value="1">Mr</option>
                    <option value="2">Mrs</option>
                    <option value="3">Ms</option>
                </select>
            </div>
            <div className='pd-input-item'>
                <div className={`pd-placeholder ${placeholder.fname}`}>First name</div>
                <input className={`fname-input pd-input ${height.fname}`} onFocus={(e)=> {
                        if(!e.target.value){
                            e.target.placeholder="" 
                            setPlaceholder({...placeholder,"fname":"dblock"})
                            setHeight({...height,"fname":"ishow"})
                        }
                    }
                } 
                onBlur={(e)=> {
                        if(e.target.value === ''){
                            e.target.placeholder="First name"
                            setPlaceholder({...placeholder,"fname":"dnone"})
                            setHeight({...height,"fname":"ihide"})
                        }
                    }
                } 
                placeholder='First name' onChange={onChangelogin}  value={credentials.firstname} type="text"  name="firstname" id="firstname"/>
            </div>
            <div className='pd-input-item'>
                <div className={`pd-placeholder ${placeholder.lname}`}>Last name</div>
                <input className={`lname-input pd-input ${height.lname}`} onFocus={(e)=> {
                        if(!e.target.value){
                            e.target.placeholder="" 
                            setPlaceholder({...placeholder,"lname":"dblock"})
                            setHeight({...height,"lname":"ishow"})
                        }
                    }
                } 
                onBlur={(e)=> {
                        if(e.target.value === ''){
                            e.target.placeholder="Last name"
                            setPlaceholder({...placeholder,"lname":"dnone"})
                            setHeight({...height,"lname":"ihide"})
                        }
                    }
                } 
                placeholder='Last name' onChange={onChangelogin}  value={credentials.lastname} type="text"  name="lastname" id="lastname"/>
            </div>
            <div className='pd-input-item'>
                <div className={`pd-placeholder ${placeholder.dob}`}>Date of birth</div>
                <input className={`dob-input pd-input ${height.dob}`} onFocus={(e)=> {
                        if(!e.target.value){
                            e.target.placeholder="" 
                            setPlaceholder({...placeholder,"dob":"dblock"})
                            setHeight({...height,"dob":"ishow"})
                        }
                    }
                } 
                onBlur={(e)=> {
                        if(e.target.value === ''){
                            e.target.placeholder="Date of birth"
                            setPlaceholder({...placeholder,"dob":"dnone"})
                            setHeight({...height,"dob":"ihide"})
                        }
                    }
                } 
                placeholder='Date of birth' onChange={onChangelogin}  value={credentials.lastname} type="date"  name="dateofbirth" id="dateofbirth"/>
            </div>
        </form>
        <div className='trip-summary-con'>
            <div className='ts-title'>Trip summary</div>
            {selectedflight.map((flight)=>{
                    return             <div className='fd-con'>
                    <div>{flight.from}</div>
                    <div>{flight.to}</div>
                    <div>{flight.departuretime}</div>
                    <div>{flight.arrivaltime}</div>
                </div>
                })}
            {/* <div className='fd-con'>
                <div>{JSON.stringify(selectedflight)}</div>
                <div>{selectedflight.to}</div>
                <div>{selectedflight.departuretime}</div>
                <div>{selectedflight.arrivaltime}</div>
            </div> */}
        </div>
    </div>
  )
}

export default Passengerdetails
